Description ♂ 
♀
.

Head
(
Figs 28–29
). Ground-colour black. Frons at broadest point 0.28 (
♂
) or 0.33 (
♀
), at lunula 0.45 (
♂
) or 0.41 (
♀
), of maximum head-width (frontal view). Fronto-orbital plate mostly shining, with a small brown pruinose area around upper frontal seta followed by a short silvery area before lunula; parafacial and face mainly yellowish pruinose, facial ridges tinged with brown; gena and lower 2/3 of occiput grey dusted, upper 1/3 of occiput undusted, shining, not differentiated from fronto-orbital plates. Frontal triangle quite broad, shining black. Parafacial narrow, at middle 1/4 (
♂
) to 1/3 (
♀
) width of postpedicel; setulae short, fine, in 1 row. Antenna black, except tip of pedicel and base of postpedicel which are orange, pedicel often more extensively orange; postpedicel 2.5 (
♂
) to 2.8 (
♀
) times as long as broad, falling short of mouth-margin by about 1/3 its length. Arista plumose, the hairing at widest point about 1.5 times width of postpedicel. Vibrissa strong, vibrissal area otherwise bare. Gena narrow, about 0.1 of vertical eye-length; genal setae weak. Palpus yellow, swollen at tip (
Fig. 29
).

Ƌ terminalia
. Epandrium attached to tergite 5, the intermediate tergite 6 and syntergosternite 8 lost; with 2 spiracles on lower anterior edge (
Fig. 35
). Sternite 6 vestigial but clearly developed, symmetrical, withdrawn beneath sternite 5. Surstylus well-developed, distinct and discrete from epandrium (
Fig. 35
). Cercal plate moderately divided (
Fig. 36
). Hypandrium attached to surstylus and, posteriorly, to wall of epandrium close to inner dorsal tip of cercal plate. Phallic complex (
Figs 37–38
): praegonite absent; postgonite weakly sclerotised, short, curved; phallapodeme enlarged, bifid at mid-length and the branches fusing with hypandrium; phallus short, juxta eversible, spinulose and containing about 7 large thorn-bearing platelets.

